import React from "react";
import styled from "styled-components";

function Skills() {
  return (
    <div>
      <h2>Skills</h2>
      <IconContainer>
        <img src="icon1.jpg" alt="Icon 1" />
        <img src="icon2.jpg" alt="Icon 2" />
        <img src="icon3.jpg" alt="Icon 3" />
      </IconContainer>
    </div>
  );
}

export default Skills;

const IconContainer = styled.div``;
